import React from 'react';
import img from '../Images/carsouel2.jpg';

export default function CategoryCard() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-sm-12 col-md-6 col-lg-4 mx-auto">
          <div className="card" style={{ width: '100%' }}>
            <img src={img} className="card-img-top" alt="Recipe Category" />
            <div className="card-body">
              <h5 className="RecipeCategory">Main Courses</h5>
              <a href="#" className="btn btn-primary">Get Recipes</a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
